import "./index.css";

const person = {
  nombre: "Rimuru",
  apellido: "Tempest",
  edad: "2",
  direccion: {
    region: "Jura Tempest",
    ciudad: "Ciudad de Rimuru",
  },
  ocupacion: "Demon Lord",
};

console.log(person);
console.table(person);
